import { RouterProvider, createBrowserRouter } from "react-router-dom";
import RootLayout from "./pages/RootLayout";
import Home from "./pages/Home";
import Events from "./pages/Events";
import EventDetailPage from "./pages/EventDetailPage";
import NewEventsPage from "./pages/NewEventPage";
import RootEventsNav from "./pages/RootEventsNav";

const router = createBrowserRouter([
  {
    path: "/",
    element: <RootLayout />,
    children: [
      { path: "/", element: <Home /> },
      {
        path: "/events", // Nested events route with layout
        element: <RootEventsNav />, // New layout component
        children: [
          { path: "/events", element: <Events /> }, // Events list page
          {
            path: "/events/:eventId", // Event details with nested layout
            element: <EventDetailPage />, // New layout component for event details
            children: [
              { path: "/events/:eventId", element: <EventDetailPage /> }, // Event details page
              { path: "/events/:eventId/edit", element: <EventDetailPage /> }, // Event edit page (assuming same layout)
            ],
          },
          { path: "/events/new", element: <NewEventsPage /> }, // New event creation page
        ],
      },
    ],
  },
]);


function App() {
  return <RouterProvider router={router} />;
}

export default App;
